import React from 'react'
import "./SideBar.css";

const Sidebar = () => {
    return (
        <div className="sidebar">
            <h2>Side Bar</h2>
            <ul>
                <li>Home</li>
            </ul>
        </div>
    );
}

export default Sidebar;
